import "bootstrap/dist/css/bootstrap.min.css"
import {BrowserRoutr as Router, Route} from "react-router-dom";
import Navbar from "./components/navbar.component";
import MovieList from "./components/movie-list.component";
import EditMovie from "./components/edit-movie.component";
import CreateMovie from "./components/create-movie.component";
import CreateUser from "./components/create-user.component";




function App() {
  return (
    <Route>
      <Navbar>
        <br/>

        <Route path = "/" exact component = {MovieList} />
        <Route path = "/edit/:id" exact component = {EditMovie} />
        <Route path = "/create" exact component = {CreateMovie} />
        <Route path = "/user" exact component = {CreateUser} />


      </Navbar>
    </Route>
  );
}



export default App;
